import React, { useEffect, useRef } from 'react';
import videojs from 'video.js';
import 'video.js/dist/video-js.css';
imp

export default function VideoPage() {
  const videoRef = useRef(null);
  let player;

  useEffect(() => {
    // Ensure the video element is available before initializing Video.js
    if (videoRef.current) {
      player = videojs(videoRef.current, {
        controls: true,
        autoplay: false,
        preload: 'auto',
      });

      return () => {
        if (player) {
          player.dispose();
        }
      };
    }
  }, []);

  return (
    <div className="video-container">
      <h1>Introduction to Cyber Safety</h1>
      <video
        ref={videoRef}
        className="video-js"
        controls
        preload="auto"
        width="720"
        height="420"
        data-setup="{}"
      >
        <source src="C:\Users\priya\Desktop\New folder (2)\task\public\Enrique Iglesias - I Like It.mp4" type="video/mp4" />
        {/* You can add other sources for different formats */}
        <p className="vjs-no-js">
          To view this video please enable JavaScript, and consider upgrading to a
          web browser that
          <a href="https://videojs.com/html5-video-support/" target="_blank">
            supports HTML5 video
          </a>
        </p>
      </video>
      <div className="video-footer">
        <button className="back-button" onClick={() => window.history.back()}>
          Back
        </button>
      </div>
    </div>
  );
}
